methods
%%
    function obj = LDPCCoding(varargin)
    % Construct a new LDPCCoding object    
         if numel(varargin) == 4
              obj.NrCodeBlocks = varargin{1}.NrCodeBlocks;
              obj.codeRate = varargin{1}.codeRate;
              obj.CodedBitsLength = varargin{1}.CodedBitsLength;
              obj.RateMatching = varargin{1}.RateMatching;
              obj.DecodingAlgorithm = varargin{1}.DecodingAlgorithm;
              obj.Iterations = varargin{1}.Iterations;
              obj.iSet = varargin{2};
              obj.BaseGraph = varargin{3};
              obj.ExtensionFactor = varargin{4};
              obj.LDPCLift(obj)
          else
              error('Number of input variables must be 4');
          end
    end
%%
    function LDPCLift(varargin)
        % Perform mod-based Lifting. Prepare partiy check
        % matrices for the encoder, and prepare Tanner graphs
        % for the decoder.
        obj = varargin{1};

        if obj.BaseGraph == 1
            switch obj.iSet
                case 1
                    EH = obj.BG1_1;
                case 2
                    EH = obj.BG1_2;
                case 3
                    EH = obj.BG1_3;
                case 4
                    EH = obj.BG1_4;
                case 5
                    EH = obj.BG1_5;
                case 6
                    EH = obj.BG1_6;
                case 7
                    EH = obj.BG1_7;
                case 8
                    EH = obj.BG1_8;
            end
            obj.DDShift = max(EH([2 3], 23));
        else
            switch obj.iSet
                case 1
                    EH = obj.BG2_1;
                case 2
                    EH = obj.BG2_2;
                case 3
                    EH = obj.BG2_3;
                case 4
                    EH = obj.BG2_4;
                case 5
                    EH = obj.BG2_5;
                case 6
                    EH = obj.BG2_6;
                case 7
                    EH = obj.BG2_7;
                case 8
                    EH = obj.BG2_8;
            end
            obj.DDShift = max(EH([2 3], 11));
        end
        
        Zc = obj.ExtensionFactor;
        [rows, cols] = size(EH);
        H = cell(rows, cols);
        A = speye(Zc,Zc);
        Zero = sparse(Zc,Zc);
        for x = 1:rows
            for y = 1:cols
                if EH(x,y) == -1
                    H{x,y} = Zero;
                else
                    H{x,y} = circshift(A, [-mod(EH(x,y),Zc),0]); 
                end       
            end
        end       
        obj.ParityCheckMatrix = cell2mat(H);
        
        % Tanner Graph calculation  
        EH3 = EH;
        EH3(EH3~=-1) = 1;
        EH3(EH3==-1) = 0;
        maxColWeight = max(sum(EH3));
        maxRowWeight = max(sum(EH3,2));

        [edgeVN, edgeCN] = find(obj.ParityCheckMatrix'); 
        numEdges = length(edgeCN);
        cnMat = zeros(Zc * rows, maxRowWeight + 1);        
        startInd = 1;
        temp = edgeCN(1);
        for ii = 2:numEdges
            if temp ~= edgeCN(ii)
                for kk = startInd:ii - 1
                    cnMat(temp, kk-startInd+1) = edgeVN(kk);
                end
                startInd = ii;
                temp = edgeCN(ii);
            end
        end                   
        for kk = startInd:ii
            cnMat(temp, kk-startInd+1) = edgeVN(kk);
        end

        [edgeCN, edgeVN] = find(obj.ParityCheckMatrix); 
        vnMat = zeros(Zc * cols, maxColWeight + 1);        
        startInd = 1;
        temp = edgeVN(1);
        for ii = 2:numEdges
            if temp ~= edgeVN(ii)
                for kk = startInd:ii - 1
                    vnMat(temp, kk-startInd+1) = edgeCN(kk);
                end
                startInd = ii;
                temp = edgeVN(ii);
            end
        end                   
        for kk = startInd:ii
            vnMat(temp, kk-startInd+1) = edgeCN(kk);
        end
        obj.CheckNodesMatrix = cnMat;
        obj.VariableNodesMatrix = vnMat;
          
    end
    
    function CodedBitsBlock = Encode(varargin)
        % LDPC encode the input bits block
        % Utilize the the structure of the 5G-NR check matrices to perform
        % low complexity encoding
        %
        % CodedBits = LDPCCoding.Encode(Input bits)
        obj = varargin{1};
        BlockBits = varargin{2}';
        Block = varargin{3};
     
        H = obj.ParityCheckMatrix;
        Z = obj.ExtensionFactor;

        [n_k, n] = size(H);
        n_k = n_k / Z;
        n = n / Z;
        k = n-n_k;
        Bsize = 4;
        v = zeros(Bsize*Z,1);
        c = H(1:Bsize*Z,1:k*Z)*BlockBits;
        b = circshift(sum(reshape(c.', [], Bsize),2), [obj.DDShift, 0]);
        v(1:Z) = b;
        c = c + H(1:Bsize*Z, k*Z+1:(k+1)*Z)*b;
        v(Z+1:2*Z) = c(1:Z);
        for ii = 3:Bsize
            v_i_1 = (ii-2)*Z+1:(ii-2)*Z+Z;   
            v(v_i_1+Z) = c(v_i_1) + v(v_i_1);
        end
        uv = [BlockBits;mod(v,2)];
        Ebits = H(Bsize*Z+1:end,1:(k+Bsize)*Z)*uv;
        codedBits = [uv;mod(Ebits,2)];
        
        % Take care of filler bits
        if Block.NrFillerBits > 0
            NULL = 98811220033.445911;
            codedBits(Block.InputBlockSize-Block.NrFillerBits+1:Block.InputBlockSize) = NULL;
        end
        
        % Puncture the first 2*Z systematic bits and apply Rate Matching
        CodedBitsBlock = obj.RateMatching.RateMatch('LDPC', codedBits(2*Z+1:end), 0, 0, Block);           
    end
 %%   
    function DecodedBlockBits = Decode(varargin)
        % LDPC decode the input Log-Likelihood Ratios (LLRs) block using the specified Decoding Algorithm
        % Apply the specified Decoding Algorithm and iteratively decode each
        % block. After each block is decoded, CRC is performed and the error
        % detection result is stored in the corresponding Block class.
        %
        % DecodedBits = LDPCCoding.Decode(Channel LLRs)
        obj = varargin{1};  
        Block = varargin{3}; 
        
        % Apply Rate Dematching
        RateDematchedLLRs = [zeros(1, 2*obj.ExtensionFactor) obj.RateMatching.RateDematch(varargin{2}, Block)];

        % Belief Propagation based decoding
        DecodedBlockBits = obj.LDPCDecode(RateDematchedLLRs); 

        % Subblock CRC calculation
        if obj.NrCodeBlocks  ~= 1
            Block.CRCDetectionResult = Coding.ChannelCodingComponents.CRC.Detect(DecodedBlockBits(1:Block.InputBlockSize-Block.NrFillerBits), '24B');
            DecodedBlockBits = DecodedBlockBits(1:Block.InputBlockSize-Block.NrFillerBits-24);
        else
            DecodedBlockBits = DecodedBlockBits(1:Block.InputBlockSize-Block.NrFillerBits);
        end 
    end
 %%
    function decodedBits = LDPCDecode(varargin)
        % Performs Belief Propagation (Sum-Product) based decoding 
        % 
        % out = LDPCDecode(Dematched LLRs, Current block)
        obj = varargin{1};
        Lj = varargin{2};
        
        cnMat = obj.CheckNodesMatrix;
        vnMat = obj.VariableNodesMatrix;
        [numCN, ColCN] = size(cnMat);
        [numVN, ColVN] = size(vnMat);
        
        % Sum-Product Algorithm
        % Initialization
        Lji = zeros(numCN, ColCN);
        for ii = 1:numCN
            for jj = 1:ColCN
                if cnMat(ii,jj) ~=0
                    Lji(ii,jj) = Lj(cnMat(ii,jj));
                else
                    break;
                end
            end
        end
%         5
        % Iterative decoding
        for iter = 1:obj.Iterations
            switch obj.DecodingAlgorithm
                case 'Sum-Product'       
                  varNodes = Coding.ChannelCodingComponents.LDPCDecodeMEX(Lj, Lji, cnMat, vnMat, numCN, ColCN, numVN, ColVN, 0);
                case 'Min-Sum'
                  varNodes = Coding.ChannelCodingComponents.LDPCDecodeMEX(Lj, Lji, cnMat, vnMat, numCN, ColCN, numVN, ColVN, 1);
                case 'PWL-Min-Sum'
                  varNodes = Coding.ChannelCodingComponents.LDPCDecodeMEX(Lj, Lji, cnMat, vnMat, numCN, ColCN, numVN, ColVN, 2);
                otherwise
                    error('The decoding algorithm is not supported.');
            end    
        end
        
        % Bits decision
        decodedBits = (1-sign(varNodes))./2;
        
    end    
   
end

